import React from "react";
import { Link } from "react-router-dom";
import {Routes, Route, useNavigate} from 'react-router-dom';


const Login = () => {
    const navigate = useNavigate();

    const navigateHome = () => {
        // üëáÔ∏è navigate to /
        navigate('/homeScreen');
      };

  return (
    <>
      <div>
        <h1>Login Page</h1>
        <button>
          <Link to="/homeScreen">Route Name</Link>
        </button>
      </div>
    </>
  );
};

export default Login;
